import React from "react";
import { connect } from "react-redux";

class ScaleTray extends React.component {
  render() {
    return (
      <div className="scale-tray">
        <p>my scale tray!</p>
        <button
          onClick={() => {
            this.props.setScaleIndex(0);
          }}
        >
          CLICK FOR MAJOR
        </button>
      </div>
    )
  }
}

export default ScaleTray
